    private MealBuilder mealBuilder = new MealBuilder();
    private Meal _meal;

    private void addItem(int itemNumber)
    {
        switch (itemNumber)
        {
            case 1:
                _meal = mealBuilder.prepareVegMeal("Lentil Burger", 250.0F);
                break;

            case 2:
                _meal = mealBuilder.prepareVegMeal("Falafil patty burger", 350.0F);
                break;

            case 3:
                _meal = mealBuilder.prepareNonVegMeal("Grilled Chicken burger", 400.0F);
                break;

            case 4:
                _meal = mealBuilder.prepareNonVegMeal("Mushroom Chicken burger", 450.0F);
                break;

            
                
            default:

                break;
        }
    }

